package logical_programe;

public class Multification {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		    int num1=45;
		    int num2=75;
		    int num=0;
		    for(int i=1;i<=num2;i++) {
		    	 num=num+num1;
		    	//i=1//=0+45..>75
		    }
		    System.out.println("multification is sum "+num);
	}

}
